/**
 * Gender
 */
export const GENDER = [
  {
    disabled: true,
    text: 'Select gender',
    value: ''
  },
  {
    text: 'Male',
    value: 'male'
  },
  {
    text: 'Female',
    value: 'female'
  }
]
